import "./App.css";
import Video from "./components/video";

function App() {

  let obj1 ={
    title: 'Through Title and Object',
    views: '11M',
    time: '2 hour ago',
    channel: 'React object',
    verified: true
  }
  return (
    <div className="App">
      <div>Videos</div>
      <Video{...obj1}></Video>
      <Video
        title="First title"
        views="100k"
        time="1 Year ago"
        channel="Nishant"
        verified = {false}
      ></Video>
      <Video
        title="second title"
        views="10k"
        time="1 Month ago"
        channel="Bhalothia"
        verified = {false}
      ></Video>
      <Video
        title="Third title"
        views="1M"
        time="1 Month ago"
        channel="third Channel"
        verified = {false}
      ></Video>
    </div>
  );
}

export default App;

